import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 56-362 Right of railroad to cross watercourse, intervening railroad, etc.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/56-362.md","filePath":"vacode/56-362.md"}'),o={name:"vacode/56-362.md"},i=t('<h1 id="§-56-362-right-of-railroad-to-cross-watercourse-intervening-railroad-etc" tabindex="-1">§ 56-362 Right of railroad to cross watercourse, intervening railroad, etc. <a class="header-anchor" href="#§-56-362-right-of-railroad-to-cross-watercourse-intervening-railroad-etc" aria-label="Permalink to &quot;§ 56-362 Right of railroad to cross watercourse, intervening railroad, etc.&quot;">​</a></h1><p>Any railroad corporation created or doing business under the laws of this Commonwealth, which shall have fully located the route of its railway, may, in the construction of such railway on such route, cross any canal, navigable stream, or watercourse between its termini, but in such manner as not unreasonably to impede the navigation and use thereof; and may also cross any railway or railroad intervening, in the manner and upon the terms prescribed by §§ <a href="http://law.lis.virginia.gov/vacode/56-17/" target="_blank" rel="noreferrer">56-17</a> to <a href="http://law.lis.virginia.gov/vacode/56-32/" target="_blank" rel="noreferrer">56-32</a>, and <a href="http://law.lis.virginia.gov/vacode/56-363/" target="_blank" rel="noreferrer">56-363</a>.</p><p>Code 1919, § 3999; 1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0114" target="_blank" rel="noreferrer">114</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0157" target="_blank" rel="noreferrer">157</a>.</p>',3),n=[i];function s(l,c,d,h,g,_){return r(),a("div",null,n)}const v=e(o,[["render",s]]);export{u as __pageData,v as default};
